import GenerateScormPage from './pages/generateScormPage';
import SecondStage from './pages/secondStage';
import FirstStage from './pages/firstStage';
import './App.css';
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'

function App() {
  return (
    <Router>
      <Routes>
        <Route exact path="/" element={<FirstStage/>}/>
        <Route exact path="/second" element={<SecondStage/>}/>
        <Route exact path="/third" element={<GenerateScormPage/>}/>
      </Routes>
    </Router>
  );
}

export default App;
